import React, { Component } from 'react'; 
import { Grommet, grommet, Box, Heading, Menu } from 'grommet';
import * as Icons from 'grommet-icons';
import { Switch, Route, Link } from 'react-router-dom';


// PAGES IMPORTED 
import Home from './pages/Home'; 
//import Help from './Help';
//import UploadPage from './Upload'; 
//import Product from './Product'; 
//import Login from './Login'; 
import Navbar from './Navbar';
//import Footer from './Footer';  
//import Errors from './Error'; 
//import FourOFour from './404.js';
//import User from './User'; 
//import UserProduct from './UserProduct';
//import Registration from './Register';
//import compare from './compare';
//import savedProduct from './savedProduct';
//import personalSetting from './personalSetting';
//import compareResult from './compareResult';
//import highlightPage from './highlightPage';
import homebg from './homebg.png'; 

const bgstyle = { 
	backgroundSize: 'cover',
	overflow: 'hidden', 
	zIndex: '1',
} 

const viewstyle = { 
	zIndex: '2', 
} 

const contentstyle = { 
	position: 'fixed',  
	zIndex: '2', 	
} 

// THE VIEW RENDERING OBJECT 
class View extends Component { 
	render() { 
		return(
			<Box> 
				<img src={homebg} style={bgstyle} /> 
				<Box style={viewstyle} justify="start"> 
					<Navbar />
					<Box style={contentstyle}> 
					<Switch> 
						<Route path='/' component={Home} /> 
					</Switch> 
					</Box> 
				</Box> 
			</Box> 
		);	
	}
} 

export default View;

